import React, { useEffect, useState } from "react";
import MyButton from "./Components/Button";
import Items from "./Components/Items";

const App = () => {
  const [myData, setMyData] = useState([]);

  const parsedDataHandler = (parsedData) => {
    setMyData(parsedData);
  }


  return (
    <div>
      <MyButton parsedData={parsedDataHandler} />
      <div>{console.log(myData)}</div>
      <div>{console.log(typeof(myData))}</div>
      <div>{console.log(JSON.parse(JSON.stringify(myData)))}</div>
      <div>{console.log(typeof(JSON.parse(JSON.stringify(myData))))}</div>
    </div>
  );
};

export default App;
